# PROTOTYPE DEFINITION
fixtureType.TraxonStrip = $channels 3

detector.c0 = $fixtureType TraxonStrip $index 0 $x 0 $y 0 $w 1 $h 1 $model net.electroland.utils.lighting.detection.RedDetectionModel $tags 1
